Verenigde Staten / Duitsland / Canada
Thriller
88 minuten

een goeie film

met Kim Basinger, Craig Sheffer en Lukas Haas

Een huisvrouw wordt gedwongen om zich te weren, wanneer ze op straat met vier moordenaars in aanraking komt. Wat begint als een 
simpele wandeling, verandert al snel in een regelrechte nachtmerrie. Het enige wat ze bezit om te kunnen overleven is een 
gereedschapskist en haar wilsbeschikking.
